import React from "react";

const Search = ({ search, setSearch }) => {
  return (
    <div>
      <form onSubmit={(e) => e.preventDefault()}>
        <label for="search">Search</label>
        <input
          type="text"
          id="search"
          autoFocus
          placeholder="Search here..."
          role="searchbox"
        />
      </form>
    </div>
  );
};

export default Search;
